import React, {useEffect, useState} from 'react';
import styles from './Success.module.scss';
const Success = (props) =>{
    const [isSuccessed, setIsSuccessed] = useState(false);
    useEffect(() =>{
        const time = setTimeout(() =>{
            console.log(1);
        }, 1000)
        return () =>{
            console.log(2);
            clearTimeout(time);
        }
    }, [])
    return(
        <div className={styles.success}>
            {props.children}
        </div>
    )
}

export default Success;
